// action for add wish board

export function addWishBoard(value){
    console.log(value)
    return{
        type: 'ADD_WISHBOARD',
        value
    }
}

export function addWish(value){
    console.log(value)
    return{
        type: 'ADD_WISH',
        value
    }
}
